import React, { Component } from 'react'
import { Switch, NavLink, Route, Redirect } from 'react-router-dom'

import Home from './Components/Home'
import Youxitese from './Components/Youxitese'
import Shequ from './Components/Shequ'
import './css/App.css'

export default class App extends Component {
    // render() {
    //     return (

    //         <div>
    //             <Welcome />
    //         </div>
    //     )
    // }

    dengluzhuce = () => {
        console.log('登录注册');
        alert('敬請期待')
    }

    render() {
        return (
            <div>
                <div className="row navHead">
                    <ul>
                        <li>
                            <NavLink className="list-group-item myActiveStyle" to="/ho" >游戏网站</NavLink>
                        </li>
                        <li>
                            <NavLink className="list-group-item myActiveStyle" to="/home" >首页</NavLink>
                        </li>
                        <li>
                            <NavLink className="list-group-item myActiveStyle" to="/youxitese" >特色</NavLink>
                        </li>
                        <li>
                            <NavLink className="list-group-item myActiveStyle" to="/shequapp" >社区</NavLink>
                        </li>
                        <li >
                            <button className='loginBtn' onClick={this.dengluzhuce}>登录/注册</button>
                        </li>
                    </ul>
                    {/* <div className="col-xs-offset-2 col-xs-8 head">
                    </div> */}
                </div>


                <div className="col-xs-6">
                    <div className="panel">
                        <Switch>
                            <Route path="/home" component={Home} />
                            <Route path="/youxitese" component={Youxitese} />
                            <Route path="/shequapp" component={Shequ} />
                            <Redirect to='/home' />
                        </Switch>
                    </div>
                </div>
            </div>
        )
    }

}
